l = '4'
h = '5'
t = input()
characters = 'ABCDEFGHIJKLMNOPQRSTUVWXYZ?'
number_of_characters = len(t)
list_of_index = list()

ASCII_art = ''

for letter in t:
    letter = letter.upper()
    if characters.find(letter) == -1:
        letter = '?'

    index_in_characters = characters.find(letter) + 1
    one_letter = l
    start_index = one_letter * index_in_characters - one_letter
    end_index = one_letter * index_in_characters
    list_of_index.append(dict(start=int(start_index), end=int(end_index)))

for i in range(h):
    row = input()
    for character_number in range(number_of_characters):
        ASCII_art = ASCII_art + row[
                                list_of_index[character_number]['start']:
                                list_of_index[character_number]['end']
                                ]
    ASCII_art = ASCII_art + '\n'

print(ASCII_art)
